import React from 'react';
import { observer } from 'mobx-react';

import InputLabel from '@material-ui/core/InputLabel';
import Select from '@material-ui/core/Select';
import MenuItem from '@material-ui/core/MenuItem';

export default observer(({ store, field }) => {
    return (
        // <div>
        //     <TextField variant='outlined' size='small' htmlFor={field.id} label={field.label} helperText={field.error} {...field.bind({ type })} />
        // </div>
        <div>
            <InputLabel id={field.label}>{field.label}</InputLabel>
            <Select labelId={field.label} id={field.id}>
                {store.data.map(c => <MenuItem key={c.id} value={c.type}>{c.type}</MenuItem>)}
            </Select>
        </div>
    )
});
